import React from 'react';
import '../../App.css';
import Cards from "../Cards";
import Footer from "../Footer";

export default function About() {
    return (
        <>
            <div className="content">
                    <h1 className="home-heading">ABOUT</h1>
                    <p className="home-text"><br></br>Hi, my name is Christina Qiu and
                        I am a sophomore at the University of Pennsylvania in the Digital Media Design Program.</p>

            </div>
            <Cards />
            <Footer />

        </>
    );
}
